import React, {Component} from 'react'
import Header from "../_layouts/_includes/header/Header";
import Content from "../_layouts/_includes/content/Content";
import Background from "../_layouts/default/Background";
import styled from 'styled-components'

const Footer = styled.div`
    position: absolute;
    left: 0;
    right: 0;
    bottom: 0;
    padding: 0;
    margin: 0;
    padding-top: 16px;
    background: transparent;
    background-color: #000000;
    text-align: left;
    width: auto;
    font-size: 12px;
    color: #8F98A0;
    border: 0;
`

const FooterContent = styled.div`
    position: relative;
    width: 960px;
    margin: 0 auto;
`

const FooterLogo = styled.span`
    position: absolute;
    left: 16px;
    top: 4px;
`
const FooterText = styled.span`

`


class ShowcaseContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {}
    }

    render() {
        return (
            <>
                <Background>
                    <Header user/>

                    <Content>
                    </Content>

                    <Footer>
                        <FooterContent>

                        </FooterContent>
                    </Footer>
                </Background>
            </>
        )
    }
}

export default ShowcaseContainer
